package femtodb.core.table.data;import java.io.*;import java.util.*;import java.util.concurrent.*;import java.util.concurrent.atomic.AtomicLong;import femtodb.core.table.*;import femtodb.core.table.transaction.*;/** * * * * */public class StoreTableManagerFolder implements Serializable {    public long storedLogNo = -1L;    public TableManager tableManager = null;    public AtomicLong transactionNo = null;    public Map<Long, TransactionNo> transactionStatusMap = null;    public StoreTableManagerFolder(long logNo) {        this.storedLogNo = logNo;    }    public long getStoredLogNo() {        return this.storedLogNo;    }    public void setTableManager(TableManager manager) {        this.tableManager = manager;    }    public TableManager getTableManager() {        return this.tableManager;    }    public void setTransactionNoObj(AtomicLong no) {        this.transactionNo = no;    }    public AtomicLong getTransactionNoObj() {        return this.transactionNo;    }    public void setTransactionStatusMapObj(Map<Long, TransactionNo> transactionStatusMap) {        this.transactionStatusMap = transactionStatusMap;    }    public Map<Long, TransactionNo> getTransactionStatusMapObj() {        return this.transactionStatusMap;    }}